import React from 'react';
import { ManagementToolNav } from '../../../common/components'

import ListGroup from 'react-bootstrap/ListGroup';

function MyProfileTemplate(props) {
    const { person } = props.viewStore;
    debugger
    return (
        <div>
            <ManagementToolNav />
            <h1>My profile</h1>
            <ListGroup className="list" as="ul">
                <ListGroup.Item as='li'>ID: {person.id}</ListGroup.Item>
                <ListGroup.Item as='li'>E-mail: {person.email}</ListGroup.Item>
                <ListGroup.Item as='li'>Company key: {person.companyId}</ListGroup.Item>
            </ListGroup>
        </div>
    )
}

export default MyProfileTemplate;
